runwasi is intended to be consumed as a library to be linked to from your own wasm host implementation. It creates one shim process per container or k8s pod. You need to implement a trait to teach runwasi how to use your wasm host. There are two ways to do this: implementing the sandbox::Instance trait or implementing the container::Engine trait The most flexible but complex is the sandbox::Instance trait: pub trait Instance { /// The WASI engine type type Engine: Send + Sync + Clone; /// Create a new instance fn new(id: String, cfg: &InstanceConfig) -> Self; /// Start the instance /// The returned value should be a unique ID (such as a PID) for the instance. /// Nothing internally should be using this ID, but it is returned to containerd where a user may want to use it. fn start(&self) -> Result<u32, Error>; /// Send a signal to the instance fn kill(&self, signal: u32) -> Result<(), Error>; /// Delete any reference to the instance /// This is called after the instance has exited. fn delete(&self) -> Result<(), Error>; /// Wait for the instance to exit /// The waiter is used to send the exit code and time back to the caller /// Ideally this would just be a blocking call with a normal result, however /// because of how this is called from a thread it causes issues with lifetimes of the trait implementer. fn wait(&self, waiter: &Wait) -> Result<(), Error>;
} The container::Engine trait provides a simplified API: pub trait Engine: Clone + Send + Sync + 'static { /// The name to use for this engine fn name() -> &'static str; /// Run a WebAssembly container fn run_wasi(&self, ctx: &impl RuntimeContext, stdio: Stdio) -> Result<i32>; /// Check that the runtime can run the container. /// This checks runs after the container creation and before the container starts. /// By default it checks that the wasi_entrypoint is either: /// * a OCI image with wasm layers /// * a file with the `wasm` filetype header /// * a parsable `wat` file. fn can_handle(&self, ctx: &impl RuntimeContext) -> Result<()> { /* default implementation*/ }
} After implementing container::Engine you can use container::Instance<impl container::Engine>, which implements the sandbox::Instance trait. To use your implementation in "normal" mode, you'll need to create a binary which has a main that looks something like this: use containerd_shim as shim;
use containerd_shim_wasm::sandbox::{ShimCli, Instance} struct MyInstance { // ...
} impl Instance for MyInstance { // ...
} fn main() { shim::run::<ShimCli<MyInstance>>("io.containerd.myshim.v1", opts);
} or when using the container::Engine trait, like this: use containerd_shim as shim;
use containerd_shim_wasm::{sandbox::ShimCli, container::{Instance, Engine}} struct MyEngine { // ...
} impl Engine for MyEngine { // ...
} fn main() { shim::run::<ShimCli<Instance<MyEngine>>>("io.containerd.myshim.v1", opts);
} Note you can implement your own ShimCli if you like and customize your wasm engine and other things. I encourage you to checkout how that is implemented. The shim binary just needs to be installed into $PATH (as seen by the containerd process) with a binary name like containerd-shim-myshim-v1. Check out these projects that build on top of runwasi: spinkube/containerd-shim-spin deislabs/containerd-wasm-shims
